import gradient from "./assets/Image.png";
import logo from "./assets/logo.svg";

export default function App() {
  return (
    <main className="bg-[#FCFCFD] w-screen p-8">
      <section className="border-b-[1px] pb-4 flex justify-between border-[#EAECF0]">
        <div>
          <h1>Welcome</h1>
          <p>Your current sales auction and activity.</p>
        </div>
        <div></div>
      </section>
      <section className="relative h-[330px] rounded-xl border-[1px] border-[#EAECF0] p-4">
        <img
          src={gradient}
          alt={"Gradient"}
          className="w-full h-[58%] rounded-lg"
        />
        <div className="flex justify-between">
          <img
            src={logo}
            alt={"Gradient"}
            className="absolute bottom-2 h-[50%] rounded-full"
          />
          <div>
            <h1>Starts in: 3 days : 2 hours : 24 minutes </h1>
            <div className="flex">
              <div>Not Live</div>
              <div>Layers Auction</div>
            </div>
          </div>
        </div>
      </section>
    </main>
  );
}
